INSERT INTO `emails` VALUES (1,'download','Download Link for $itemName','<p>Hi $firstName,</p>\r\n<p>Thank you for your purchase of $itemName. The following information are your purchase details, sent from paypal:</p>\r\n<p>Txn ID: $transID <br /> Paypal Email: $payerEmail <br /> Item Name: $itemName <br /> Item #: $itemNumber<br /> Payment Status: $paymentStatus <br />Payment Amount: $itemPrice <br /> Paid to: $receiverEmail</p>\r\n<p>&nbsp;</p>\r\n<p>This is an automatically generated message from our system regarding your order from us. If the status is \"Completed\", that means your order went through, and you may download your ebook immediately. If not, then please wait for the payment to be completed.</p>\r\n<p>You can download the ebook through this link:</p>\r\n<p><strong><a href=\"$downloadLink\">$downloadLink </a></strong></p>\r\n<p>&nbsp;</p>\r\n<p>Customers receive exclusive access to the customers only newsletter.You will receive the latest tips and tricks on how to improve your PTC business. You will also be the first to get special discounts or free offers on new products being released (if there are any) - so sign up today:</p>\r\n<p><a href=\"http://lcp.trwv.net/lcp/theemperor/nuscustomers\">http://lcp.trwv.net/lcp/theemperor/nuscustomers</a></p>\r\n<p>&nbsp;</p>\r\n<p>On top of that, customers who become affiliates have access to free updates of the ebook. You can download conveniently from your members area - the ebook is often, because quality is important to us.</p>\r\n<p>&nbsp;</p>\r\n<p>Before you download your product, we urge you to check out the NUS Video Course, a product created due to the demand of our subsribers. It is a video series that shows you step by step how to use the Neobux Ultimate Strategy to build a system where you get referrals on auto-pilot.</p>\r\n<p>For more info, go to this link:</p>\r\n<p>http://neobuxultimatestrategy.com/video-course</p>\r\n<p>Please note the videos are in English only.</p>\r\n<p>&nbsp;</p>\r\n<p>&nb