INSERT INTO `newsletter` VALUES ('customer-newsletter','Subscribed to the Customer Newsletter Yet?','Dear valued customer, \r\n\r\nYou are receiving this message because you are customer\r\nof the Neobux Ultimate Strategy ebook or the NUS Video Course.\r\n\r\nThank you for trusting us and taking a leap of faith to buy\r\nthe ebook. Whether you bought the ebook a few months ago or\r\njust recently, making you follow the strategies and principles\r\nset forth to turbo-boost your ptc business. You can make a rock-solid\r\nincome within 30 days if you put in the effort and commit the\r\ntime. \r\n\r\nWe want to stay in touch with you through a series of \r\nnewsletters written especially for customers like yourself. \r\n\r\nThe sign up link is\r\nhttp://www.trafficwave.net/lcp/theemperor/nuscustomers\r\n\r\nWith most businesses the relationship ends with a sale. With us it is different. The relationship begins with a sale. \r\n\r\nSo sign up today - and we\'ll see you on the other side. \r\n\r\n*********************************************************\r\nIf you already subscribed then please accept our apologies. \r\nThis message was intended for those who have not subscribed\r\nyet. \r\n\r\n \r\nNeobux Ultimate Strategy\r\nadmin@bestpayingsites.com\r\nhttp://neobuxultimatestrategy.com'),('video-course','The NUS Video Course - Special Offer for Customers Only','Dear valued customer,\r\n\r\nYou are receiving this special offer because you are a valued customer of the Neobux Ultimate Strategy - \r\n\r\nAs a thank you for being a customer, you can get the Video Course for $17.00\r\n\r\nA product like this can sell easily for $47 or more, and that\\\'ll probably be the launch price. It could be anywhere from $27, $37, or $47. I haven\\\'t decided yet. Most likely it will be $47.\r\n\r\nBut one thing is for sure. As we are developing this course, you can save some money by pre-ordering now - before the product is completed.\r\n\r\n\\\"But why should I buy if the product isn\\\'t completed\\\" I can hear you saying\r\n\r\nOnce you order, your info will be recorded into our system, and you will then be given a members account - where you can log in and download the Video Course at any time.\r\n\r\nBasically it\\\'s the same as pre-ordering a video game that hasn\\\'t been released yet. You pay a smaller fee by taking action early, before everyone else. And once the game comes out, your spot has already been \\\"reserved\\\" and you don\\\'t need to fight other people for the game.\r\n\r\nSo would you rather pay $17.00 or pay $47.00 when the course is released?\r\n\r\nTo get the video course, just visit the site below:\r\nhttp://neobuxultimatestrategy.com/video/\r\n\r\nIf you have the Neobux Ultimate Strategy then you know that the strategies in it are proven to work, they are timeless techniques that work no matter what your experience level is. This course shows you how to implement those techniques step by step - so you can see for yourself and follow along - to set up your referral system. \r\n\r\nIf you\\\'re interested in the video course then I suggest you get it early (like today!) and get it at a low price. \r\n\r\nIf you want it but you\\\'re not sure yet...that\\\'s cool, you can get it later. It\\\'s just that the price won\\\'t be the same - but it\\\'s up to you. \r\n\r\nhttp://neobuxultimatestrategy.com/video/\r\n\r\nSee you on the other side. \r\n\r\nSincerely, \r\nBenjamin L\r\nadmin@bestpayingsites.com'),('eps-system','Make $15 to $25 For Every Email You Process!','Dear valued customer, \r\n\r\nHave you always wanted to make a full time income from home, but never knew how? Well now you can, with the Email Profit System! \r\n\r\nYou are guaranteed to make $15 to $25 for every email you process - there is no limit to how much you can do daily. Using our system, you can easily make $3,750 a month, without reporting to a boss, and working your own hours\r\n\r\nHere are just some of the benefits: \r\n\r\n*	3 time-tested, guaranteed methods to making money online\r\n*	Get paid $15 to $25 for every email you process - up to $100 to $200 a day! \r\n*	All payments sent directly to your Paypal account or by check - choose how you paid! \r\n*	No spamming necessary - spam is illegal and prohibited. This system will have people wanting to hear from you! \r\n*	Step-by-step detailed instructions on setting up your own Email Processing system! \r\n\r\nTo get this program now, go to:\r\nhttp://bestpayingsites.com/eps\r\n\r\nSee you on the other side! \r\n\r\nSincerely, \r\n\r\nBenjamin L.\r\nPaypal Booster\r\nptc@bestpayingsites.com'),('subscribe-newsletter','Can You Make $20 to $30 a Day from PTC\'s?','Hi fellow PTC User, \r\n\r\nNeobux is the #1 PTC website in the industry. With over 20,000,000 members, Neobux is without a doubt, a legitimate company, with a low $2 cashout and instant payments. However, how many of those 20 million do you think actually makes any money?\r\n\r\nThe ugly truth of the matter is, most people who join PTC\'s barely make any money, and those who\'ve invested money come out at a loss. Many of those who try PTC\'s do so with the right intentions....they work hard patiently, hoping to eventually make profit. But after months of hard work, they are not seeing results, become frustrated, and ultimately give up.\r\n\r\nWhat they need is a working strategy. The Neobux Ultimate Strategy is your guide to prospering and profiting with Neobux. It also works with any PTC, as the principles are the same.\r\n\r\nHere is a partial list of what you will get from the eBook:\r\n\r\n* How to get 40+ direct referrals virtually overnight for any PTC you want\r\n* How to set up a system that allows you to get referrals on auto-pilot\r\n* How to avoid common pitfalls that 90% of users make that prevents them from succeeding - don\'t follow these rules, and you will end up like most others\r\n* How to determine which referrals are profitable and which ones to recycle, leaving you an army of active clickers\r\n\r\nWe are offering a free e-course on PTC\'s. There is a free ebook included for subscribing.\r\n\r\nThe sign up page is: http://neobuxultimatestrategy.com/?action=freereport\r\n\r\nThis e-course is completely free, so there is no risk to you. This is the #1 PTC Newsletter in the industry. But don\'t take our word for it, sign up and find out for yourself. The link to download the ebook is included in the e-course. \r\n\r\nSo grab a copy today... hurry, everyone else is getting their hands on this. Don\'t miss out. \r\n\r\nYours truly, \r\n\r\nNeobux Ultimate Strategy\r\nneobuxultimatestrategy.com\r\nadmin@bestpayingsites.com'),('nus-update','NUS Update - New Bonuses Added','Hi there, \r\n\r\nYou are receiving this message because you are a customer of the NUS Video Course. The product has been updated, and you as a customer are entitled to free life time updates. \r\n\r\nThe following files have been updated:\r\n\r\n4-DownlineRefs-B.zip \r\nSound quality has been improved and more content added\r\n\r\nSo go ahead and re-download those files now. \r\nSome new videos will be added in the near future. \r\n\r\nCheers, '),('nusLaunch','Make Monthly Commissions From the NUS!','Dear valued customer, \r\n\r\nWe are happy to announce that the NUS will soon be launching on JVZoo. The NUS will become a membership site - all the content that\'s in the download file will be up for display inside the members area. This includes the NUS Guide and the NUS Video Course as well. \r\n\r\nIf  you bought any of our products, then you don\'t have to do anything - just log in to your members area as you usually do to access your content. Your username and password was given to you at the time of purchase. \r\n\r\nFor more details, click here:\r\nhttp://neobuxultimatestrategy.com/?action=JVLaunch\r\n\r\nYou can make a lot of money selling the NUS as an affiliate. All you have to do is sign up on Clickbank.com and sell our products. Since the NUS will be a monthly membership, you can make commissions month after month from just one sale. \r\n\r\nThis launch is going to be huge, so you don\'t want to miss out. Check your emails for updates - see you on the other side.\r\n\r\nSincerely, \r\n\r\n\r\nNeobux Ultimate Strategy\r\nadmin@bestpayingsites.com\r\nhttp://neobuxultimatestrategy.com'),('ptc-ms','NUS - Thank You For Your Purchase','Dear valued customer,\r\n\r\nThank you for ordering the Neobux Ultimate Strategy from us. Customers like you are the most important asset to our business. The relationship begins after the sale, it does not end after the sale is made. \r\n\r\nThat\'s why we have a special promotion only for customers and subscribers - have you always wanted to have your own PTC website, but never got around to it? \r\n\r\nDon\'t know how to make a free website? Don\'t know HTML? Don\'t have the budget to hire a web designer? \r\n\r\nWell you don\'t need any of those things...because you can get the PTC Mini-Sites service. Why struggle to make a website if you don\'t know how? Have someone else do it for you. \r\n\r\nIn a nutshell, here\'s what you\'ll get:\r\n\r\n* Small One Time Fee & Free Hosting\r\n* Promote All Your Sites with Your Own Unique URL\r\n* Unlimited Lifetime Updates for Free\r\n* Quality & Quickness - Satisfaction Guaranteed!\r\n* Keep Your Files Forever\r\n* And much, much, more!\r\n\r\nIf you\'ve always wanted to have your own website, but think that you could never afford it, think again. To get more details, please visit this link:\r\nhttp://neobuxultimatestrategy.com/minisite\r\n\r\nHappy earnings.\r\n\r\nNeobux Ultimate Strategy\r\nhttp://neobuxultimatestrategy.com\r\nadmin@bestpayingsites.com'),('nus-confirm','How Are Things Going? ','Hi, \r\n\r\nI just wanted to drop a note to thank you for your recent purchase of the NUS. You\'ve placed your trust in us, and we want to make sure that you have gotten access to the members area and reading the material.\r\n\r\nRemember the most important thing about the strategy is to implement what you\'ve learned. If you have any questions or concerns, feel free to drop us an email. Don\'t be a stranger. \r\n\r\nNew bonuses will be coming monthly, so log in often for updates. \r\n\r\n\r\nSincerely,\r\n\r\nNeobux Ultimate Strategy\r\nadmin@bestpayingsites.com \r\nhttp://neobuxultimatestrategy.com');
